/*Table structure for table `t_nj_order_detail` */

CREATE TABLE `t_nj_order_detail` (
  `ORDER_DETAIL_ID` int(11) NOT NULL AUTO_INCREMENT,
  `ORDERS_ID` int(11) DEFAULT NULL,
