/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `TRIGGER_UPDATE_NJ_ORDERNO` AFTER UPDATE ON `t_nj_orders` FOR EACH ROW BEGIN
